import React,{useState} from 'react'
import FunctionMouse from './FunctionMouse'

function MouseConatainer() {
    const [display,setDisplay]=useState(true)
    return (
        <div>
            <button 
            onClick={()=>setDisplay(!display)}>
            {display? 
            <div>true it is <FunctionMouse/></div>:<div>false it is</div>}
            </button>
        </div>
    )
}

export default MouseConatainer
